import React, { useState, useEffect } from "react";
import axios from "axios";
function App() {
    const [data, setData] = useState(null);

    useEffect(() => {
        let results;
        axios
            .get("/fakeData")
            .then((data) => {
                results = data.data;
            })
            .then(setData(results));
        console.log(data);
    }, []);

    return <div className="App"></div>;
}

export default App;
